import React, { useState, useEffect } from 'react';

const Navbar: React.FC = () => {
  const [activeSection, setActiveSection] = useState('home');

  useEffect(() => {
    const handleScroll = () => {
      const sections = ['home', 'branding', 'planning', 'projects', 'tattoo'];
      const current = sections.find(section => {
        const el = document.getElementById(section);
        if (el) {
          const rect = el.getBoundingClientRect();
          return rect.top >= -100 && rect.top <= 400;
        }
        return false;
      });
      if (current) setActiveSection(current);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const navItems = [
    { label: 'Branding', id: 'branding' },
    { label: 'Planning', id: 'planning' },
    { label: 'Projects', id: 'projects' },
    { label: 'Tattoo', id: 'tattoo' },
  ];

  const scrollTo = (id: string) => {
    const el = document.getElementById(id);
    if (el) {
      const offset = 80;
      const bodyRect = document.body.getBoundingClientRect().top;
      const elementRect = el.getBoundingClientRect().top;
      const elementPosition = elementRect - bodyRect;
      const offsetPosition = elementPosition - offset;

      window.scrollTo({
        top: offsetPosition,
        behavior: 'smooth'
      });
    }
  };

  return (
    <nav className="fixed top-0 left-0 right-0 z-50 bg-black/80 backdrop-blur-md border-b border-white/10">
      <div className="max-w-screen-xl mx-auto px-6 py-4 flex items-center justify-between">
        <button 
          onClick={() => scrollTo('home')}
          className="text-xl font-serif italic font-bold tracking-tight text-white"
        >
          Creative.
        </button>
        <div className="hidden md:flex gap-8">
          {navItems.map((item) => (
            <button
              key={item.id}
              onClick={() => scrollTo(item.id)}
              className={`text-sm uppercase tracking-widest transition-colors ${
                activeSection === item.id ? 'text-white font-bold' : 'text-zinc-500 hover:text-white'
              }`}
            >
              {item.label}
            </button>
          ))}
        </div>
        {/* Mobile quick nav */}
        <div className="flex md:hidden gap-4 overflow-x-auto no-scrollbar scroll-smooth">
          {navItems.map((item) => (
            <button
              key={item.id}
              onClick={() => scrollTo(item.id)}
              className={`text-[10px] uppercase tracking-tighter whitespace-nowrap px-2 py-1 rounded transition-all ${
                activeSection === item.id ? 'bg-white text-black font-bold' : 'text-zinc-400'
              }`}
            >
              {item.label}
            </button>
          ))}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;

